function toc(){var e=document.getElementById("_instructions"),r=["H1","H2","H3","H4","H5","H6"],l=e.querySelectorAll(r),t="<ul>",n="";l.forEach(e=>{for(var l=r.indexOf(e.tagName),a=l-n;0!=a;)a>0&&(t+="<ul>",a--,n++),a<0&&(t+="</ul>",a++,n--);t+='<li><a class="hyperlink text-muted" href="#'+e.innerText.toLowerCase().replace(/\s/g,"-").replace("/","").replace(")","")+'">'+e.innerText.replace("<","").replace(">","")+"</li>"}),t+="</ul>",document.getElementById("_sidebar").innerHTML=t}